import Toolbar from "../../components/Toolbar/index";
import styles from "./Inicial.module.scss";
import { Link } from "react-router-dom";
import Ellipse from "../../assets/components_img/Ellipse 1.png";

export default function Inicial() {
  return (
    <body>
      <header>
        <Toolbar />
      </header>
      <div>
        <div className={styles.house}>
          <h1 className={styles.house__text}>Descarte sustentável e seguro.

          <br>
          </br>
          Use Descartech!</h1>


          <img className={styles.house__ellipse} src={Ellipse} alt="ellipse da page"></img>
          </div>

          <div>
            <Link to={"/cadastro"}>
              <button className={styles.button}>Cadastra-se</button>
            </Link>
            <Link to={"/login"}>
              <button className={styles.button}>Já tenho conta</button>
            </Link>
          </div>



        </div>

    </body>
  );
}
